import React from "react";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import AboutImg from "../assets/3.jpg";
const Service = () => {
  return (
    <>
      <Navbar />
      <Hero
        cName="hero-mid"
        heroImg={AboutImg}
        title=" Service"
        btnClass="hide "
      />
      <Footer />
    </>
  );
};

export default Service;
